import About from "./ComponentsIndex/About";
import Banner from "./ComponentsIndex/Banner";
import Contact from "./ComponentsIndex/Contact";
import Menu from "./ComponentsIndex/Menu";
import React from "react";

export default function Home() {
  return (
    <>
      <Banner />
      <About />
      <Menu />
      <Contact />
    </>
  );
}
